  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:39.840106\",\n\t\"name\": \"an-environmental-quality-assessment-of-tennessee-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Samples were collected at the Duck River
  Unit, Busseltown Unit, and big Sandy Unit of Tennessee National Wildlife Refuge
  from 1996 to 1998. Fish and sediment samples were obtained at each of these units.
  Semi-permeable membrane devices were deployed at the Duck River Unit. Wood duck
  (Aix sponsa) eggs were also collected at the Duck River Unit. Comparisons of the
  data collected for this investigation are made to previous data collected at Tennessee
  NWR in the Tennessee River watershed, Cross Creeks NWR in the Cumberland River watershed,
  and 5 refuges in the Mississippi River watershed of West Tennessee. Our data is
  also compared to data generated as part of the Biomonitoring of Environmental Status
  and Trends (BEST) program conducted by the United States Geological Survey (USGS)
  and United States Fish and Wildlife Service (FWS). These comparisons are intended
  to document temporal and spatial patterns of various contaminants in select species
  and sediments in the major watersheds within the state of Tennessee.\",\n\t\"license_title\":
